import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./TLogin.css";

export default function TLogin() {
  const [isLogin, setIsLogin] = useState(true);
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    fullName: "",
    subject: "",
    semester: "",
    email: "",
    password: ""
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // ðŸ” Teacher Login
  const handleLogin = async () => {
    const res = await fetch("http://localhost:5000/api/teacher/login", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        email: formData.email,
        password: formData.password
      })
    });

    const data = await res.json();

    if (res.ok) {
      localStorage.setItem("teacher_id", data.teacher.id);
      navigate("/teacherdashboard");
    } else {
      alert(data.message);
    }
  };

  // ðŸ“ Teacher Signup
  const handleSignup = async () => {
    const res = await fetch("http://localhost:5000/api/teacher/signup", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(formData)
    });

    const data = await res.json();

    if (res.ok) {
      alert("Teacher signup successful");
      setIsLogin(true);
    } else {
      alert(data.message);
    }
  };

  return (
    <div className="main_container">
      <div className="container">
        <div className="form-container">
          <div className="form-toggle">
            <button
              className={isLogin ? "active" : ""}
              onClick={() => setIsLogin(true)}
            >
              Login
            </button>

            <button
              className={!isLogin ? "active" : ""}
              onClick={() => setIsLogin(false)}
            >
              SignUp
            </button>
          </div>

          {isLogin ? (
            <div className="Loginform">
              <h2>Teacher Login</h2>
              <input
                type="email"
                name="email"
                placeholder="Email"
                onChange={handleChange}
              />
              <input
                type="password"
                name="password"
                placeholder="Password"
                onChange={handleChange}
              />
              <button onClick={handleLogin}>Login</button>
            </div>
          ) : (
            <div className="Loginform">
              <h2>Teacher SignUp</h2>
              <input
                type="text"
                name="fullName"
                placeholder="Full Name"
                onChange={handleChange}
              />
              <input
                type="text"
                name="subject"
                placeholder="Subject"
                onChange={handleChange}
              />
              <input
                type="text"
                name="semester"
                placeholder="Semester"
                onChange={handleChange}
              />
              <input
                type="email"
                name="email"
                placeholder="Email"
                onChange={handleChange}
              />
              <input
                type="password"
                name="password"
                placeholder="Password"
                onChange={handleChange}
              />

              <button onClick={handleSignup}>SignUp</button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}


